    var xRectTextOffset = 15;
    var circleDimension = 20;
    var commonDimension = 40;
    var timeArray = [];
    if (d3.select('#heat-map-svg , #date-axis-svg')) {
      d3.select('#heat-map-svg').remove();
      d3.select('#date-axis-svg').remove();
    }


    // Set the width and height of the heatmap and color range
    var margin = {top: 20, right: 20, bottom: 20, left: 80};
var persons=[];
var times = [];
var timeArray = [];

    datasets.forEach((data) => {
      if (persons.indexOf(data.user) === -1) {
        persons.push(data.user);
      }
      if (times.indexOf(data.userDate) === -1) {
        times.push(data.userDate);
      }
    });

    times.forEach((time, i, arr) => {
      var splitDate = time.split('-');
      timeArray.push(splitDate[0] + '-' + splitDate[1]);
    });
var productuctiveValue= 'all';

    var width = 1400 - margin.left - margin.right;

    var gridSize = Math.floor(width / times.length);

    var mapHeight= persons.length * commonDimension;

    var height = mapHeight + margin.bottom;

    var legendElementWidth = gridSize * 2;

var yScale = d3.scale.linear()
    .domain([0, d3.max(persons, function(d){ return d; })])
    .range([height, 0]);

var yAxis = d3.svg.axis()
.scale(yScale)
.orient("left")
.innerTickSize(-width)
.outerTickSize(0)
.tickPadding(70);
    // craete fixed dateRange for timelabel
    
        d3.select('#date-axis')
            .append('svg')
            .attr('width', this.width + this.margin.left + this.margin.right)
            .attr('height', 20)
            .attr('id', 'date-axis-svg')
            .append('g')
            .attr(
                'transform',
                'translate(' + this.margin.left + ',' + this.margin.top + ')')
            .selectAll('.timeLabel')
            .data(timeArray)
            .enter()
            .append('text')
            .text((d) => {
              return d;
            })
            .attr(
                'x',
                (d, i) => {
                  return ((i * this.gridSize) + 8);
                })
            .attr('y', 0)
            .style('fill', '#fff')
            .style('font-size', '8pt')
            .attr('class', 'timeLabel mono axis axis-worktime');

  

    // create the Heatmap area
    var svg =
        d3.select('#chart')
            .append('svg')
            .attr('width', this.width + this.margin.left + this.margin.right)
            .attr('height', this.height)
            .attr('id', 'heat-map-svg')
            .append('g')
            .attr('transform', 'translate(' + this.margin.left + ',' + 0 + ')');

//Y Axis line
  svg.append("g")
      .attr("class", "y axis")
      .call(yAxis);


    // draw the user label in Y personLabels axis
    svg.selectAll('.personLabels')
        .data(persons)
        .enter()
        .append('text')
        .text((d) => {
          return d;
        })
        .attr('x', 0)
        .attr(
            'y',
            (d, i) => {
              return (i * commonDimension) + 30;
            })
        .style('text-anchor', 'end')
        .style('fill', '#fff')
        .style('font-size', '8pt')
        .style('text-transform', 'uppercase')
        .attr('class', (d, i) => {
          return (
              (i >= 0 && i <= 4) ? 'dateLabel mono axis axis-workweek' :
                                   'dateLabel mono axis');
        });

 var PRODUCTIVE_SCALE = {
  LESS: 4,
  HIGH: 8
};
  
    //  Map the colorScale to whole scale
    this.colorScale = (productive) => {
      var lowColor = '#ff8d00';
      var highColor = '#7aff00';
      switch (productuctiveValue) {
        case 'lowproductive':
          if (productive <= PRODUCTIVE_SCALE.LESS) {
            return lowColor;
          } else {
            return 'transparent';
          }

        case 'highproductive':
          if (productive > PRODUCTIVE_SCALE.LESS) {
            return highColor;
          } else {
            return 'transparent';
          }


        default:
          if (productive <= PRODUCTIVE_SCALE.LESS) {
            return lowColor;
          } else {
            return highColor;
          }
      }

    };

    var cards = svg.selectAll('hour').data(datasets);
    cards.append('tidrawHeatMaptle');
    cards.enter()
        .append('rect')
        .attr(
            'x',
            (d) => {
              return (
                  (times.indexOf(d.userDate) * (this.gridSize)) +
                  xRectTextOffset);
            })
        .attr(
            'y',
            (d) => {
              return ((persons.indexOf(d.user) * commonDimension) + 15);
            })
        .attr('rx', 100)
        .attr('ry', 100)
        .attr(
            'val',
            (d) => {
              return d.productiveTime;
            })
        .attr(
            'user',
            (d) => {
              return d.user;
            })
        .attr('class', 'hour bordered')
        .attr('width', circleDimension)
        .attr('height', circleDimension)
        .style('fill', 'transparent')
        .style('stroke-width', 2)
        .attr('stroke', '#262626')
       
        .attr(
            'stroke',
            (d) => {
              if (d.productiveTime === 'EMPTY') {
                return '#2f2f2f';
              }
              return this.colorScale(Number(d.productiveTime));
            })
        .style('fill', 'transparent');

    cards.select('title').text((d) => {
      return d.productiveTime;
    });

    cards.enter()
        .append('text')
        .text((d) => {
          if (d.productiveTime === 'EMPTY') {
            return '';
          }
          return d.productiveTime;
        })
        .attr(
            'x',
            (d) => {
              return (
                  (times.indexOf(d.userDate) * (gridSize)) +
                  xRectTextOffset + (circleDimension / 2));
            })  // Center text
        .attr(
            'y',
            (d) => {
              return ((persons.indexOf(d.user) * commonDimension) + 28);
            })
        .style('font-size', '10px')
        .style('text-anchor', 'middle')
        .style('cursor', 'pointer')
        
        .attr('fill', (d) => {
          return this.colorScale(Number(d.productiveTime));
        });
    cards.exit().remove();
